css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("coles.com.au") {

#promoContainer, .panelTab, 
.panel .panelTab > span, input,
.pred-menu
{
background: #000000 !important;
}
#footer, #contentPane,
.headerWrapper, .wrapper,
.pageBottom div, #localisation,
#statusBarContainer, th, select,
#statusBar li, #tabs li, input,
#subnav li, #subnav li a:hover,
.pageShadow, .grad-aqua1
{
background: #222222 !important;
}
#footer a, .product-url, .brand,
.price, .saving, .unit-price,
.compare, .action-addToList, .list,
.keywords, .cat-facet, .item,
#keywords li a, #page-heading,
.pageInfo, .pageInfo span, .size,
.breadcrumb li, .breadcrumb li a,
.title, #statusItemsContent p, .divider,
#viewTrolley, #price, .currency,
.wrap, #localisation h1, p, input,
.plain-box, #tabs li a, .pred-menu,
h1, h2, h3, h4, h5, h6, .searchKeywordTerm,
#subnav li a, .ad a, select, input
{
color: #FFFFFF !important;
}
}
